import React from 'react'
import mealImage from '../../Assets/Background.jpg'

const Header  = (props) => {
  return (
    <>
      <header className='He'>
        <h1>Food_land</h1>
<button>Cart</button>
      </header>
      <div>
        <img src={mealImage} alt='not_found' className='main-image' />
      </div>
    </>
  )
}

export default Header;
